import React from 'react';
function App() {

    return (

        <>
            <h1>Here is the addition {add(40, 4)}</h1>
            <h1>Here is the sub {sub(40, 4)}</h1>
            <h1>Here is the mul {mul(40, 4)}</h1>
            <h1>Here is the div {div(40, 3)}</h1>
        </>
    );

}



function add(a, b) {

    return a + b;
}
function sub(a, b) {

    return a - b;
}
function mul(a, b) {

    return a * b;
}
function div(a, b) {

    return (a / b).toFixed(3);
}

export default App;
